            details: [
                "M.S. in Data Analytics Engineering, Northeastern University",
								"B.S. in Applied Mathematics, Tsinghua University"
            ],
            imageSrc: "haotian.png", // Replace with actual image path
            link: "/"
        },
        {
            name: "Abhinav Nippani",
